    "description" : "\"How do we create art? What are the scientific principles within an artwork’s materials that allow us to appreciate it? How can we use the creative sparks at the art/science interface to innovate the future? \nThis course examines “meaning” and “meaning-making” through learning about common scientific principles that are inherent in materials used for artistic creation. How do egg yolks turn into paint on a canvas? What are the optics of pigment and perception? What are the composite properties present in creating hand-made paper? Students will formulate such questions about art in the context of the natural world, and foster an appreciation for the discoveries at the interface of art and science. \nIn this course, students will apply learned science principles in a variety of hands-on studio sessions, experiment with creating art through the mechanics of differing mediums, and discuss the ways in which science and art fields supplement and affect one another in a larger societal context. The class will be an approachable way for artists to engage in creative scientific discussions around materials used in the artistic process and for scientists to appreciate theories applied within the arts and aesthetics. Students will leave this course having developed a greater appreciation for art, materials science, and creative expression — preparing them to become multifaceted innovators of the future.\"",
