    "description" : "Introduction to fundamentals of soil mechanics will include phase relationships, grain size, plasticity, soil classification, and clay mineralogy.  The effect of water in soils, including capillarity, shrinkage and swelling, permeability, seepage and effective stress will be discussed.  Consolidation, settlement, compressibility, failure theory, and the strength of sands and clays will be investigated. Design considerations will be discussed. Introduction to fundamentals of foundation engineering will include subsurface exploration methods and lateral earth pressures. The design of shallow and deep foundations, including pile installation and geophysical and geotechnical site investigation will be presented. CEVE 471, the undergrad version, includes a lab.  Students in CEVE 571 (GR version—does not include a laboratory) will be required to do more advanced assignments and a project. Cross-list: CEVE 471. Mutually Exclusive: Cannot register for CEVE 571 if student has credit for CEVE 470/CEVE 471/CEVE 570.",
