    "id" : "RCEL 506",
    "description" : "Data Science has taken the world by storm. Examples of great success can be seen everywhere. This has opened the way for myriad industries and sectors to try to develop their own best practices. Especially since the COVID pandemic, data science, machine learning, artificial intelligence, and other computational technologies have grown rapidly during the past couple of years. However, not everyone knows which, how, when, or why to implement these techniques. Many engineers, for example, oversee or work with daily streams of data and want to use them in the most efficient way possible. The main objective of this course is to provide a comprehensive introduction to statistical and computational methods for modern data problems faced by engineers and engineering managers. By using statistical frameworks and data science as main drivers, the student will survey and compare algorithms for various data applications, learning how to select the most suitable according to real life scenarios.\n\nIn order to enroll in an online section of this course, you are expected to have a working camera and microphone.  During class sessions, you must be able to participate using your microphone and you are expected to have your camera on for the duration of the class so that you are visible to the instructor and other students in the class, just as you would be in an in person class.",
