    "id" : "RCEL 501",
    "description" : "Technology-based innovation is the grand driver of economic progress, which hinges on strong technical leadership guiding engineering teams in mid-to-large corporate organizations and startup to small companies. By surveying and learning about the different type of EML approaches, this course outlines a framework for engineering professionals to progress from engineering manager to engineering executive (e.g., Vice President of Engineering, Chief Technology Officer). Practical methods from the engineering management literature that addresses technology-based innovation issues that have engineering management implications will be introduced. Seminal technology management principles, such as disruptive innovation, leaderless technology development, and digital platform strategy, found in companies ranging in size from start-up to large, will be examined. \n\nIn order to enroll in an online section of this course, you are expected to have a working camera and microphone.  During class sessions, you must be able to participate using your microphone and you are expected to have your camera on for the duration of the class so that you are visible to the instructor and other students in the class, just as you would be in an in person class.",
