    "id" : "HART 558",
    "description" : "This class will explore painting in France from approximately 1865 to 1900. Mixing lectures and classroom discussion, we will focus on individual artists including Claude Monet, Edgar Degas, Mary Cassatt, Georges Seurat, Vincent van Gogh, and Paul Czanne. We will also consider and discuss a set of critical issues surrounding these painters, including the politics of gender and class within the changing urban setting of Paris. For each lecture, Graduate Students will be assigned additional readings. They will write an annotated bibliography of all these readings to be turned in at  the end of the semester. We will meet for an additional every two or three weeks to discuss interpretive and methodological problems and ideas associated with the readings. Graduate Students will be expected to complete all the requirements of the class in additional to writing a substantial research paper due at the end of the semester. Cross-list: HART 358. Mutually Exclusive: Cannot register for HART 558 if student has credit for HART 358.",
