    "description" : "\"Crochet isn’t just about art and self-expression – from counting stitches and rows to calculating the yardage to finish a garment, math is the foundation for all forms of this famous fiber art, especially clothing design. How can an understanding of mathematics help us create art with purpose and pattern? And how can these mathematical patterns be incorporated into clothing design, of all things? \nIn this course, students will visualize and utilize mathematical patterns through crochet garment design – from understanding the relationship between hook size and garment gauge, to crocheting flat, simple shapes and panels that can be assembled into fully wearable clothes. This class will explore crochet fashion through a mathematical lens, using geometry to understand how to assemble 2D shapes such as perfect circles and squares. Students will be taught the basics of crochet, understand how combinations of the six most common crochet stitches can form complex and sophisticated motifs, and be able to produce their own unique crochet patterns by the end of this course (including a pattern for a 6x6” square). Students are not expected nor assumed to have any crochet or math background prior to this course.\"",
